class Solution(object):
    def findAnagrams(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        left = right = 0
        needs = dict()
        windows = dict()
        valid = 0
        res = []   # 存放索引
        for item in p:
            windows[item] = 0
            if item in needs:
                needs[item] += 1
            else:
                needs[item] = 1
        while right < len(s):
            cur = s[right]
            right += 1
            if cur in needs:
                windows[cur] += 1
                if windows[cur] == needs[cur]:
                    valid += 1
            # 当滑动窗口的尺寸 >= 匹配串p的尺寸时,缩小滑动窗口
            #  right - left 通常等于len(p)
            while right - left >= len(p):
                if valid == len(needs):
                    res.append(left)
                pop_item = s[left]
                left += 1
                if pop_item in needs:
                    # 当windows[pop_item]<needs[pop_item]时,valid不会一直减
                    if windows[pop_item] == needs[pop_item]:
                        valid -= 1
                    windows[pop_item] -= 1
        return res
